import React, { Component } from 'react';
import './App.css';
import Person from './person.js';

class People extends Component {
  render() {
    let people = [
      ['Onno', 'https://medium.com/neodotlife/onno-faber-part-2-c51d042ca4c4', 'RDMD, NF2 Project'],
      ['Ryan', 'https://twitter.com/rrhoover', 'Product Hunt'],
      ['Aakash', 'https://github.com/aakashs', 'ItsMe, Houseparty'],
      ['Greg', 'https://gkoberger.com/', 'ReadMe'],
      ['Alex', 'https://twitter.com/maccaw', 'Clearbit'],
      ['Justin', 'https://twitter.com/jwmares', 'Kettle & Fire'],
      ['Spike', 'https://www.linkedin.com/in/spike-lipkin-8173651b/', 'Newfront Insurance'],
      ['Darshan', 'https://twitter.com/DShankar', 'BigScreen'],
      ['Trevor', 'https://www.google.com/search?q=trevor+mcfedries', 'Brud, Miquela'],
      ['Hooked', 'https://itunes.apple.com/us/app/hooked/id1024818709', 'Chat stories'],
      ['BetterUp', 'https://www.betterup.co/', 'Employee well-being'],
      ['Dreams', 'https://dreams.tv/', 'Mobile broadcast TV'],
      ['Anchor', 'https://anchor.fm/', 'Easy podcasting'],
      ['Go', 'https://itunes.apple.com/us/app/go-insurance-savings-based/id910338092', 'Car insurance'],
    ]
    return (
      <div className={'ui three column doubling grid'}>
        {people.map((i) => {
          return (
            <Person name={i[0]} url={i[1]} desc={i[2]} key={i[0]} location={i[3]}/>
          );
        })}
      </div>
    );
  }
}

export default People;
